class IssueTracker:
    def __init__(self):
        self.issues = []

    def log_issue(self, issue):
        self.issues.append(issue)

    def get_issues(self):
        return self.issues


class ValidationManager:
    def __init__(self):
        self.validation_rules = []

    def update_validation_rule(self, rule):
        self.validation_rules.append(rule)

    def validate_data(self, data):
        for rule in self.validation_rules:
            if not rule(data):
                return False
        return True


class DFileManager:
    def __init__(self):
        self.requests_cache = {}

    def generate_d_file(self, request_id):
        if request_id not in self.requests_cache:
            self.requests_cache[request_id] = f"D File generated for request {request_id}"
        return self.requests_cache[request_id]


class UserTesting:
    def __init__(self):
        self.results = []
        self.is_testing = False

    def start_testing(self):
        self.is_testing = True

    def report_results(self, result):
        if not self.is_testing:
            raise Exception("Testing has not started.")
        self.results.append(result)

    def end_testing(self):
        self.is_testing = False


