class BrokerUser:
    def __init__(self):
        self.error_messages = []

    def upload_and_validate(self, message):
        if self.validate_message(message):
            self.error_messages.append(message)
            return "Message valid and uploaded."
        return "Message validation failed."

    def validate_message(self, message):
        return bool(message)  # Simplified validation logic

