class SystemAdministrator:
    def __init__(self):
        self.data_users = []

    def process_user_deletions(self):
        self.data_users.clear()

    def redesign_resources_page(self, resources_page, new_styles):
        resources_page.redesign(new_styles)

    def initiate_user_testing(self, user_testing):
        user_testing.start_testing()


